final class RandomUtils {
    private static Random random;
    private static long seed;
    static {
        seed = System.currentTimeMillis();
        random = new Random(seed);
    }
    public static int getUniform(int N) {
        return random.nextInt(N);
    }

    public static double getUniform() {
        return random.nextDouble();
    }

    public static Boolean flipCoin(double p) {
        return getUniform() < p;
    }
}

class MutableInt {
    int value = 1;
    public void increment () { ++value;      }
    public int  get ()       { return value; }
    public String toString() { return String.valueOf(value); }
}

class SymbolNGram {
    private int n;
    private String bos = "";
    private String eos = "";
    private Map<String, MutableInt>[] stat;
    private int[] clFreq;
    private Double[] cacheClass;
    private int totalCnt;
    private double[] lambda;
    private int[] unigramCount;
    private int totalClasses;

    private Map<String, Double>[] cache;

    SymbolNGram(int n, int classNum, double[] l) {
        this.n = n;
        totalClasses = classNum;
        stat = (HashMap<String, MutableInt>[]) new HashMap[classNum];
        cache = (HashMap<String, Double>[]) new HashMap[classNum];
        cacheClass = new Double[classNum];
        clFreq = new int[classNum];
        unigramCount = new int[classNum];
        lambda = l;
        for (int i = 0; i<classNum; i++) {
            stat[i] = new HashMap<String, MutableInt>();
            cache[i] = new HashMap<String, Double>();
        }
        for (int i = 0; i < n-1; i++) {
            bos += "*";
            eos += "#";
        }
    }

    public void learnSentence(String s, int classNum) {
        String bs = bos + s.trim() + eos;
        clFreq[classNum]++;
        totalCnt++;
        for (int i = 0; i < bs.length(); i++) {
            for (int j = 0; j < n; j++) {
                if (i - j >= 0) {
                    String word = bs.substring(i-j, i+1);
                    MutableInt count = stat[classNum].get(word);
                    if (count == null) stat[classNum].put(word, new MutableInt());
                    else count.increment();
                    if (word.length() == 1) {
                        unigramCount[classNum]++;
                    }
                }
            }
        }
    }

    public int getCount(String word, int classNum) {
        MutableInt count = stat[classNum].get(word);
        if (count == null) return 0;
        else return count.get();
    }

    public double getNgramClassProbabilities(String word, int classNum) {
        double result = 0;
        String unigram = word.substring(n-1, n);
        //System.out.println(unigram + " " + getCount(unigram, classNum) + " " + unigramCount[classNum]);
        result += lambda[0] * getCount(unigram, classNum) / unigramCount[classNum];

        for (int j = 1; j < n; j++) {
            String jgram = word.substring(n-1-j, n);
            if (getCount(jgram, classNum) > 0) {
                //System.out.println(jgram + " " + jgram.substring(0, j) + " " + getCount(jgram, classNum) + " " + getCount(jgram.substring(0, j), classNum));
                result += lambda[j] * getCount(jgram, classNum) / getCount(jgram.substring(0, j), classNum);
            }
        }
        return result;
    }

    public double getLogNgramClassProbabilities(String word, int classNum) {
        if (cache[classNum].get(word) == null) {
            cache[classNum].put(word, Math.log(getNgramClassProbabilities(word, classNum)));
        }
        return cache[classNum].get(word);
    }

    public double getClassProbability(int classNum) {
        return 1. * clFreq[classNum] / totalCnt;
    }

    public double getLogClassProbability(int classNum) {
        if (cacheClass[classNum] == null) {
            cacheClass[classNum] = Math.log(getClassProbability(classNum));
        }
        return cacheClass[classNum];
    }

    public double[] getSentanceProbabilities(String s) {
        String bs = bos + s.trim() + eos;
        double[] result = new double[totalClasses];

        for (int i = n - 1; i < bs.length(); i++) {
            String word = bs.substring(i - n + 1, i+1);
            for (int j = 0; j < totalClasses; j++) {
                //System.out.println(getLogNgramClassProbabilities(word, j));
                result[j] += getLogNgramClassProbabilities(word, j);
                //System.out.println(result[j]);
                //System.out.println(word + " " + getLogNgramClassProbabilities(word, j));
            }
        }
        return result;
    }

    public int classifySentence(String s) {
        double[] probs = getSentanceProbabilities(s);
        //for (int j = 0; j < totalClasses; j++) {
           // probs[j] += getLogClassProbability(j);
        //}

        int argmax = 0;
        Double currentMax = Double.NEGATIVE_INFINITY;
        for (int i = 0; i < totalClasses; i++) {
            if (probs[i] > currentMax) {
                currentMax = probs[i];
                argmax = i;
            }
        }
        return argmax;
    }

    public void setLambda(double[] l) {
        lambda = l;
    }
}

class StochasticLogistic {

    private double rate;
    public double[] weights;

    public StochasticLogistic(int n) {
        this.rate = 0.0001;
        weights = new double[n];
    }

    public void train(List<Instance> instances) {
        for (int n=0; n<30; n++) {
            double error = 0.0;
            for (int i=0; i<instances.size(); i++) {
                int[] x = instances.get(i).vector();
                double predicted = classify(x);
                int label = instances.get(i).label();
                for (int j=0; j<weights.length; j++) {
                    weights[j] = weights[j] + rate * (label - predicted) * x[j];
                }
                error += label * Math.log(classify(x)) + (1-label) * Math.log(1- classify(x));
            }
            System.out.println("iteration: " + n + " " + Arrays.toString(weights) + " error: " + error);
        }
    }

    public double classify(int[] x) {
        double logit = .0;
        for (int i=0; i< weights.length; i++) {
            logit += weights[i] * x[i];
        }
        return sigmoid(logit);
    }
    private double sigmoid(double z) {
        return 1 / (1 + Math.exp(-z));
    }

}

class Instance {
    private int label;
    private int[] vector;

    public Instance(int label, int[] vector) {
        this.label = label;
        this.vector = vector;
    }

    public int label() {
        return label;
    }

    public int[] vector() {
        return vector;
    }

    public String toString() {
        return Arrays.toString(vector) + " label: " + label;
    }
}

